./src/theme/theme.scss._style:
@import url(https://fonts.googleapis.com/css?family=Roboto:400,700);/* http://meyerweb.com/eric/tools/css/reset/
   v2.0 | 20110126
   License: none (public domain)
*/
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed,
figure, figcaption, footer, header, hgroup,
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: inherit;
  vertical-align: baseline;
  box-sizing: border-box;
}

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure,
footer, header, hgroup, menu, nav, section {
  display: block;
}

body {
  line-height: 1;
}

ol, ul {
  list-style: none;
}

blockquote, q {
  quotes: none;
}

blockquote:before, blockquote:after,
q:before, q:after {
  content: '';
  content: none;
}

table {
  border-collapse: collapse;
  border-spacing: 0;
}

html {
  font-family: "Roboto", sans-serif;
  font-size: 14px;
  color: #5a5a5a;
}

h1, .h1 {
  font-size: 28px;
  font-weight: 700;
  margin-top: 1em;
  margin-bottom: 0.2em;
}

h2, .h2 {
  font-size: 16.8px;
  font-weight: 700;
  margin-top: 1em;
  margin-bottom: 0.2em;
}

h3, .h3 {
  font-size: 14px;
  font-weight: 700;
  margin-top: 1em;
  margin-bottom: 0.2em;
}

h1:first-child, h1 + *, .h1:first-child, .h1 + * {
  margin-top: 0;
}

h2:first-child, h2 + *, .h2:first-child, .h2 + * {
  margin-top: 0;
}

h3:first-child, h3 + *, .h3:first-child, .h3 + * {
  margin-top: 0;
}

p, span, li {
  font-size: 14px;
  color: inherit;
}

p {
  line-height: 1.5em;
  margin: 0;
}

p + p {
  margin-top: 1em;
}

a {
  transition: all 0.2s;
  color: #e62739;
  text-decoration: none;
}

a:visited, a:active {
  color: #e62739;
}

a:hover, a:focus {
  color: #eb5563;
}

.container {
  padding: 0 3vmin;
}

ul {
  list-style: none;
}

./src/components/shared/styles/button.sc._style:
.btn, a.btn {
  color: #9068be;
  font-size: 14px;
  text-align: center;
  font-weight: 700;
  line-height: 1em;
  border: 2px solid #9068be;
  display: block;
  width: 100%;
  padding: 15px 10px;
  cursor: pointer;
  background-color: inherit;
  transition: all .2s;
}

.btn:hover, a.btn:hover {
  color: #e1e8f0;
  background-color: #9068be;
}

.btn + .btn, a.btn + .btn {
  margin-top: 15px;
}

.btn.btn-cta, a.btn.btn-cta {
  color: #e62739;
  border-color: #e62739;
}

.btn.btn-cta:hover, a.btn.btn-cta:hover {
  color: #e1e8f0;
  background-color: #e62739;
}
